    "2016-11-25T21:06:28.344019",nt"name": "national-evaluation-of-the-comprehensive-technical-assistance-centers",nt"isopen":
    true,nt"url": null,nt"notes": "The National Evaluation of the Comprehensive
    Technical Assistance Centers (CTAC Evalution) is a study of the National Evaluation
    of the Comprehensive Technical Assistance Centers (CTAC Evaluation) program. CTAC
    Evaluation (http://ies.ed.gov/ncee/projects/evaluation/other_techcenters.asp) includes
    cross-sectional surveys, cross-sectional interviews, and ratings of Center products
    that are designed to examine the Comprehensive Technical Assistance Centers (CTAC)
    program, a Federally funded program that provides technical assistance to states
    in connection with the No Child Left Behind Act (NCLB). Specifically, the study
    examines Center objectives and activities and assesses the quality of Center products.
    The study was conducted using surveys and interviews of State Education Agencies
    (SEAs), project participants, and Center staff. The study includes a sample of Center
    projects for review, a sample of project participants (response rate between 73%
    and 76%), and a census of SEAs (response rate of 90%). Key statistics produced from
    CTAC Evaluation are about the quality, relevance, and usefulness of Center projects
    and descriptive statistics about Center operations.",nt"license_title": "Creative
